function CatmullRom(a,b,c,d,e){var f=0.5*(d-b),g=0.5*(e-c),h=a*a;return(2*c-2*d+f+g)*(a*h)+(-3*c+3*d-2*f-g)*h+f*a+c}function QuadraticBezierP0(a,b){var c=1-a;return c*c*b}function QuadraticBezierP1(a,b){return 2*(1-a)*a*b}function QuadraticBezierP2(a,b){return a*a*b}function QuadraticBezier(a,b,c,d){return QuadraticBezierP0(a,b)+QuadraticBezierP1(a,c)+QuadraticBezierP2(a,d)}function CubicBezierP0(a,b){var c=1-a;return c*c*c*b}function CubicBezierP1(a,b){var c=1-a;return 3*c*c*a*b}function CubicBezierP2(a,b){return 3*(1-a)*a*a*b}function CubicBezierP3(a,b){return a*a*a*b}function CubicBezier(a,b,c,d,e){return CubicBezierP0(a,b)+CubicBezierP1(a,c)+CubicBezierP2(a,d)+CubicBezierP3(a,e)}export{CatmullRom,QuadraticBezier,CubicBezier};